import{_ as e,o as t,c as n,O as a}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 60.2-307 Moneys constituting fund.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/60.2-307.md","filePath":"vacode/60.2-307.md"}'),o={name:"vacode/60.2-307.md"},i=a('<h1 id="§-60-2-307-moneys-constituting-fund" tabindex="-1">§ 60.2-307 Moneys constituting fund. <a class="header-anchor" href="#§-60-2-307-moneys-constituting-fund" aria-label="Permalink to &quot;§ 60.2-307 Moneys constituting fund.&quot;">​</a></h1><p>The fund shall consist of all moneys appropriated by this Commonwealth, and all moneys received from the United States, any agency thereof or any other source, for the purpose declared in § <a href="http://law.lis.virginia.gov/vacode/60.2-308/" target="_blank" rel="noreferrer">60.2-308</a>. Notwithstanding any provision of this article, all moneys requisitioned and deposited in this fund pursuant to the provisions of subsection C of § <a href="http://law.lis.virginia.gov/vacode/60.2-305/" target="_blank" rel="noreferrer">60.2-305</a> shall remain part of the Unemployment Trust Fund and shall be used only in accordance with the conditions specified in § <a href="http://law.lis.virginia.gov/vacode/60.2-305/" target="_blank" rel="noreferrer">60.2-305</a>.</p><p>Code 1950, § 60-96; 1956, c. 440; 1960, c. 54; 1968, c. 738, § 60.1-113; 1986, c. 480.</p>',3),r=[i];function s(c,d,l,h,_,f){return t(),n("div",null,r)}const m=e(o,[["render",s]]);export{u as __pageData,m as default};
